var fountaintuples = [];
var matches = 0;
var matcheswithdata = 0;
var tuplestocreate = [];
var tuplestoupdate = [];
var datatoupdate = [];

console.log("Launching conversion script...");

function outputArray(obj, prefix) {
  var result = "";
  if(Array.isArray(obj)) {
    result = result + prefix + "LEN: " + obj.length + "</p>";
    for(var i = 0 ; i < obj.length ; i++) {
      result = result + outputArray(obj[i], prefix + "[" + String(i) +"]&nbsp;&nbsp;&nbsp;");
    }
  } else {
    result = result + prefix + "*** " + String(obj) + "</p>";
  }
  return result;
}

// recurse until we get some good data!
function queryOverpassWithDataIndex(index, retry) {
  if(retry > 10) {
    console.log("Retry for index " + index + " exceeds 10 times, bailing.");
    return;
  } else if(retry > 0) {
    console.log("About to retry index " + index + ", retry #" + retry);
  }

  var tuple = fountaintuples[index];
  var coords = tuple[2];

  // i think this is about 100m??
  var delta = 0.00005;

  var ql = "node(" +
    String(coords[0] - delta)+","+
    String(coords[1] - delta)+","+
    String(coords[0] + delta)+","+
    String(coords[1] + delta)+")[amenity=drinking_water];out meta;";

  query_overpass(ql, (function(tuple, index) {
    return function(error, osmData) {
      if(error) {
        console.log("ERROR["+ error.statusCode + "] for " + index + ": " + error.message);
        if(osmData) {
          console.log("******* RESULTS ARE DEFINED!!!! *******");
        }
        if(true) { //error.statusCode == 429) { just do for ANY error

          // retry after 0-60 seconds and bail!
          setTimeout( (function(ind, ret) {
            return function() {
              queryOverpassWithDataIndex(ind, ret + 1);
            }
          }(index, retry)), Math.random() * 60000);
          return;
        }
      }

      matches++;
      if(osmData && osmData['features'] && osmData['features'].length > 0) {
        matcheswithdata++;
        console.log(matches + " / " + fountaintuples.length + ", ["+ index + "]: " + tuple +
          " with matching data!: " + JSON.stringify(osmData));
          tuplestoupdate.push(tuple);
          datatoupdate.push(osmData);
      } else {
        console.log(matches + " / " + fountaintuples.length + ", ["+ index + "]: " + tuple +
          " no data found:" + JSON.stringify(osmData));
        tuplestocreate.push(tuple);
      }

      console.log("PROGRESS:: matches: " + matcheswithdata + " results: " + matches + " / " + fountaintuples.length);

      if(matches == fountaintuples.length) {
        console.log("Done!");
        console.log("Totals:: matches: " + matcheswithdata + " results: " + matches + ") / " + fountaintuples.length);


        console.log("TO CREATE: " + JSON.stringify(tuplestocreate));
        console.log("TO UPDATE: " + JSON.stringify(tuplestoupdate));
        console.log("DATA TO UPDATE: " + JSON.stringify(datatoupdate));
      }
    }
  })(tuple, index));
}

